@test integrate(x*(a+b*exp(c+d*x))^-1, x) == :((1/2)*a^-1*x^2+-1*a^-1*d^-2*Polylogarithms.polylog(2,-1*b*a^-1*exp(c+d*x))+-1*x*a^-1*d^-1*log(1+b*a^-1*exp(c+d*x)))
